pub enum Event {
    Acquire {
        from: Option<ResourceAccessPoint>,
    },
    Duplicate {
        to: Option<ResourceAccessPoint>,
    },
    Copy {
        from: Option<ResourceAccessPoint>,
    },
    Move {
        to: Option<ResourceAccessPoint>,
    },
    MutableLend {
        to: Option<ResourceAccessPoint>,
    },
    MutableBorrow {
        from: ResourceAccessPoint,
    },
    MutableDie {
        to: Option<ResourceAccessPoint>,
    },
    MutableReacquire {
        from: Option<ResourceAccessPoint>,
    },
    StaticLend {
        to: Option<ResourceAccessPoint>,
    },
    StaticBorrow {
        from: ResourceAccessPoint,
    },
    StaticDie {
        to: Option<ResourceAccessPoint>,
    },
    StaticReacquire {
        from: Option<ResourceAccessPoint>,
    },
    OwnerGoOutOfScope,
    RefGoOutOfScope,
