pub enum State {
    OutOfScope,
    ResourceMoved {
        move_to: Option<ResourceAccessPoint>,
        move_at_line: usize,
    },
    FullPrivilege,
    PartialPrivilege {
        borrow_count: u32,
        borrow_to: HashSet<ResourceAccessPoint>,
    },
    RevokedPrivilege {
        to: Option<ResourceAccessPoint>,
        borrow_to: Option<ResourceAccessPoint>,
    },
    Invalid,
}
